      return (

<div>
  <h1>Diet for adult dogs and puppies</h1>
    <p> 
      I feed Open farm or home cooked/baked oragnic dog treats, and orginc prenatal vitamins during the pregnacy that i make daily!
      Open Farm provides human grade quailty food, support small farms and provide a very healthy dog food!
      I feed open farm food to all my adult dogs and puppies.
      One of the best parts of open farm is there ingredients list is all able to be trace back to its source through thier website.
      Tracable ingredients makes me feel like i am providing the best food i can buy to my furry family members!
      My adult dogs are a fan of all the dry dog foods, they have had all the stews as a topper to dry dog food, bone broth is something
      i buy once or twice a month for a treat and each bone brothe bag last quite a while and they all love it!
      The training treats are amazing and the freeze dried food is a favorite as well!
      My adult dogs and puppies I provide have an amazing quailty of life and health and one of the reason to thank for that is open farm!
    </p>
<p>

Just like most other dogs Cairn's do Not like to be left alone for extended
    period of time, like more then 8 hours a day, if they are left alone that long or longer you can experience destructive behavior from your cairn
    like barking or
</p>

