      The only other food type item i recommend is called a no hide from Earth Animals. No hide is a raw hide alternative that
      wont wreck havac on your furry friends diegestive track like raw hides will. No hide is a great healthy treat that i make sure
      i always have around, its the only thing i can buy that they cant chew up in 20 mins and its made with healthy ingredients!
    </p>
    <p>
    My general rule of thumb for food is, if walmart sells it i dont feed it. Not because of walmart but becuase of the food 
    quailty. The only food i would ever come close to recommending from walmart is fresh pet select, you should be safe with 
    pretty much any of fresh pet select food options. 
    </p>
